import React from "react";
import logo from "../../assets/logo.svg";

const Header = () => {
  return (
    <header className="header">
      <div className="header__inner">
        <div className="header__logo">
          <img src={log}/>
        </div>
        <div className="header__login">

        </div>
      </div>
    </header>
  );
};

export default Header;
